import { createWebHashHistory, createRouter } from "vue-router";
import App from "./App.vue";
import Login from "./components/Login.vue";
const routes = [
  {
    name: "Form",
    path: "/form",
    component: Form,
  },
  {
    name: "Login",
    path: "/login",
    component: Login,
  },
];
const router = createRouter({
  history: createWebHashHistory(),
  routes,
});
export default router;
